  "Contract Number": "00000000000000000000000003457",
  "Summary": "This Memorandum of Understanding ('Memorandum') is entered into by and between the Indiana Department of Environmental Management (IDEM) Office of Water Quality Wastewater Operator Certification and the Indiana Professional Licensing Agency (IPLA). In consideration of those mutual undertakings, the parties agree as follows:",
  "Whereas Sections": [
    "WHEREAS, IDEM has established a need for information technology support services;",
    "WHEREAS, IPLA has in place a full Information Technology (IT) licensing support staff and a complete licensing system consisting of three integrated pieces: 1) MyLicense Office (MLO) that handles all back office licensing functions, 2) eGov - the internet module that allows applicants and licensees to renew licenses and apply for licensure and 3) eVerification which is the web module that allows the public to verify license status and information;",
    "WHEREAS, the software licenses for MyLicense Office, eGov and eVerification allow IPLA and IDEM to share the products and licensing maintenance;",
    "WHEREAS, a working relationship between IDEM and IPLA will allow IDEM to take advantage of the resources and skill sets already in place, leveraging State assets such as Information Technology staff, software and hardware;",
    "WHEREAS, this relationship will save IDEM the expense of purchasing its own system, eliminate development and infrastructure expense, eliminate the need to maintain its own Information Technology (IT) licensing support staff, and share on-going operational expenses;",
    "WHEREAS, IPLA and IDEM wish to enter into an agreement that will provide for such an ongoing relationship;"
  ],
  "Purpose": {
    "Section I": "PURPOSE",
    "Description": "The purpose of this MOU is to define the conditions and terms for an agreement between IDEM and IPLA for the on-going administration of the State enterprise licensing systems."
  },
  "Provisions": {
    "Section II": "PROVISIONS",
    "Description": {
      "a": "IPLA, as administrator, will provide full use of the enterprise licensing system products known as MyLicense Office (back office MLO Web Application), eGov (Licensee Web Application) and eVerification (public verification web application) and access to functionality as covered in software and maintenance agreements between IPLA and the licensing software vendor - System Automation. In general, the ongoing relationship with the software vendor will be managed by IPLA. The software vendor bills IPLA directly for maintenance costs."
    }
  }
}
